import React, { Component } from 'react';
import '../../scss/Works.scss';
import ScrollAnimation from 'react-animate-on-scroll';
import ChipsHTML from './Chips/ChipsHTML';
import ChipsSASS from './Chips/ChipsSASS';
import ChipsBootstrap from './Chips/ChipsBootstrap';
import ChipsJavascript from './Chips/ChipsJavascript';
import ChipsAPI from './Chips/ChipsAPI';
import Box from '@material-ui/core/Box';

const Style = {
    github: {
        color: 'rgb(241, 240, 179)',
        marginRight: 25
    },
    internet: {
        color: 'rgb(109, 195, 221)',
        margin: 5
    }
};

export default class Works extends Component {
    render() {
        return (
            <article className="Works" id="myWorks">
                <ScrollAnimation animateIn="bounceInLeft">
                    <div className="caseOne">
                        <div className="icons">
                            <ChipsHTML/>
                            <ChipsSASS/>
                            <ChipsBootstrap />
                        </div>
                        <div className="socials">
                            {/* eslint-disable-next-line */}
                            <a><i class="fab fa-github fa-5x" href="" style={Style.github}></i></a>
                            {/* eslint-disable-next-line */}
                            <a><i class="fas fa-globe fa-5x" style={Style.internet}></i></a>
                        </div>
                    </div>
                </ScrollAnimation>
                <ScrollAnimation animateIn="bounceInRight">
                    <div className="caseTwo">
                        <div className="icons">
                            <ChipsHTML />
                            <ChipsSASS />
                            <ChipsJavascript />
                        </div>
                        <Box display="flex">
                            {/* eslint-disable-next-line */}
                            <a><i class="fab fa-github fa-5x" style={Style.github}></i></a>
                            {/* eslint-disable-next-line */}
                            <a><i class="fas fa-globe fa-5x" style={Style.internet}></i></a>
                        </Box>
                    </div>
                </ScrollAnimation>
                <ScrollAnimation animateIn="bounceInLeft">
                    <div className="caseThree">
                        <div className="icons">
                            <ChipsHTML />
                            <ChipsSASS />
                            <ChipsBootstrap />
                            <ChipsJavascript />
                            <ChipsAPI />
                        </div>
                        <Box display="flex">
                            {/* eslint-disable-next-line */}
                            <a><i class="fab fa-github fa-5x" style={Style.github}></i></a>
                            {/* eslint-disable-next-line */}
                            <a><i class="fas fa-globe fa-5x" style={Style.internet}></i></a>
                        </Box>
                    </div>
                </ScrollAnimation>
                <ScrollAnimation animateIn="bounceInRight">
                    <div className="caseFour">
                        <div className="icons">
                            <ChipsHTML />
                            <ChipsSASS />
                            <ChipsBootstrap />
                            <ChipsJavascript />
                            <ChipsAPI />
                        </div>
                        <Box display="flex">
                            {/* eslint-disable-next-line */}
                            <a><i class="fab fa-github fa-5x" style={Style.github}></i></a>
                            {/* eslint-disable-next-line */}
                            <a><i class="fas fa-globe fa-5x" style={Style.internet}></i></a>
                        </Box>
                    </div>
                </ScrollAnimation>
                <ScrollAnimation animateIn="wobble" initiallyVisible={true}>
                    <p>Cette section sera régulièrement mise à jour</p>
                </ScrollAnimation>
            </article>
        );
    }
}
